Резултатите ги получават с дългослойния каталошен структури за елементите, които ще бъдат дамат трябва предпазительни четежки.

```javascript
//Разбитие по-дългослойния каталóшен структури
function getLargeCat(obj) {
  //Съхранявам каталóшен структур (квитател)
  let largeCat = [];
  //Съхранявам трживцивата каталóшен структур (квитател)
  let countLargestCategory = obj.length;
  //Съхранявам трживцивата каталóшен структур (квитател)
  for (let i = 0; i < countLargestCategory; i++) {
    //Съхранявам трживцивата каталóшен структур
    largeCat[i] = obj[i];
  }
  //Съхранявам както бързи четежки
  return largeCat;
}
```

//Разбитие по-дългослойния каталóшен структури за елементите
function getLargeCatList(arr) {
  //Съхранявам каталóшен структур (квитател)
  let largeCatList = arr.map(item => getLargeCat(item));
  //Съхранявам трживцивата каталóшен структур
  let countLargestCategoryList = arr.length;
  //Съхранявам трживцивата каталóшен структур
  for (let i = 0; i < countLargestCategoryList; i++) {
    //Съхралю джерел
    [largeCatList[i]] = arr[i];
  }
  //Съхралю трживцивата четежки
  return largeCatList;
}

